(1) Following plural possessives or object particle and elements incorporating it
(2) After the genitive plural of the defi nite article in nominal phrases or fossilized examples
in place names
(3) In verbs affecting only voiceless consonants after the following particles:

after cha /ha/ ‘not’: /ha ˈvel/ ‘is not’ (in speech /ha ˈnel/ with lenition);
after dy /də/ ‘that’: /də ˈvel/ ‘that is’;
after nagh /nax/ ‘that not’: /nax ˈvel/ ‘that is not’;
after mannagh /manax/ ‘if not’: /manax ˈvel/ ‘if is not’;
after roish my /roːs´ mə/ ‘before’:/roːs´ mə ˈd´em ˈroːm/ ‘before I go my way’ (Job
10:21);
after dy/də/ ‘if’ (conditional): /də ˈvodax s´u d´enu s´en/ ‘if you could do that’

